    const FLAG_AUTOPILOT = 'autopilot';
    const CONQUEST_ATTACK_TILE_CD = 120;

    protected function request($action, $extraFields = array())
    {
        $url = sprintf('%s?user_id=%s&message=%s', $this->apiUrl, $this->userId, $action);

        $time = 0;
        if ($action != 'init') {
            $time = ceil((time() - $this->timeDiff) / (60 * 15));
        }
        $ccache = md5($time . $this->userId);
        $hash = md5($action . $time . $this->timeHash);

        $postData = array(
            ''                  => '',
            'flashcode'         => $this->flashCode,
            'time'              => $action == 'init' ? '0' : $time,
            'version'           => $action == 'init' ? '' : $this->version,
            'hash'              => $hash,
            'ccache'            => '',
            'client_code'       => $this->clientCode,
            'rc'                => 2
        );

        if (!empty($this->authToken)) {
            $postData['game_auth_token'] = $this->authToken;
        }

        foreach ($extraFields as $f => $v) {
            $postData[$f] = $v;
        }

        $c = $urlPostData = '';
        foreach ($postData as $f => $v) {
            $urlPostData .= $c . $f . '=' . urlencode($v);
            $c = '&';
        }
        $headers = array(
            'User-Agent: Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.17 (KHTML, like Gecko) Chrome/25.0.1313.58 Safari/538.18',
            'Accept: text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8',
            'Accept-Language: ru-RU;q=0.6,en;q=0.4',
            'Accept-Charset: utf-8;q=0.7,*;q=0.3',
            'Referer: http://tyrantonline.com/Main.swf?' . $this->version,
        );
        $ch = curl_init();
        curl_setopt($ch, CURLOPT_URL, $url);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
        curl_setopt($ch, CURLOPT_HEADER, false);
        curl_setopt($ch, CURLOPT_TIMEOUT, 10);
        curl_setopt($ch, CURLOPT_HTTPHEADER, $headers);

        if (!empty($extraFields['url'])) {
            curl_setopt($ch, CURLOPT_URL, $extraFields['url']);
        } else {
            curl_setopt($ch, CURLOPT_POST, true);
            curl_setopt($ch, CURLOPT_POSTFIELDS, $urlPostData);
        }
        sleep(3);
        $res = curl_exec($ch);
        curl_close($ch);
        if (!empty($extraFields['raw'])) {
            return $res;
        }
        $d = @json_decode($res, true);

        if (!empty($d['time'])) {
            $this->timeDiff = time() - $d['time'];
        }

        if (!empty($d['version']) && $this->version != $d['version']) {
            $this->event_versionChanged($d['version']);
        }
        if (!empty($d['user_data']['max_energy'])) {
            $this->maxEnergy = $d['user_data']['max_energy'];
        }
        if (!empty($d['client_code'])) {
            $this->clientCode = $d['client_code'];
        }

        return $d;
    }

    protected function event_versionChanged($version)
    {
        $this->version = $version;
    }

    public function init()
    {
        $init = $this->request('init');
        $this->activeDeckId = $init['user_data']['active_deck'];
        $this->defenseDeckId = $init['user_data']['defense_deck'];
        $this->factionId = $init['faction_id'];

        if (empty($init['user_data']['flags']['autopilot'])) {
            $this->setUserFlag(self::FLAG_AUTOPILOT, 1);
        }

        $this->energy = $init['user_energy'];
        $this->staminaTime = $this->energyTime = time();
        $this->stamina = $init['user_data']['stamina'];
        $this->myCards = $init['user_cards'];
        $this->myDescks = $init['user_decks'];
    }

    public function wait($sec)
    {
        $this->a2l(sprintf("[SLEEP][sec %d]", $sec));
        for ($i = 0; $i < $sec; $i++) {
            sleep(1);
        }
    }

    public function getFactionId()
    {
        return $this->factionId;
    }

    public function getEnergy()
    {
        return $this->energy + floor((time() - $this->energyTime) / 60) - $this->supplyOfEnergy;
    }

    public function getStamina()
    {
        return $this->stamina + floor((time() - $this->staminaTime) / 60) - $this->supplyOfStamina;
    }

    public function setContainer($logger)
    {
        $this->container = $logger;
    }

    public function a2l($str)
    {
        $this->container->write($str, $this->logName);
    }

    public function getActiveWars($index = 0)
    {
        $wars = $this->request('getActiveFactionWars');
        if (empty($wars['wars'])) {
            return false;
        }
        $i = 0;
        foreach ($wars['wars'] as $id => $p) {
            if ($index == $i) {
                return $p;
            }
            $i++;
        }
        return false;
    }

    public function fightRaidBoss($raidId)
    {
        $rb = $this->request('fightRaidBoss', array('user_raid_id' => $raidId));
        return $rb;
    }

    public function fightFactionBattle($fightId)
    {
        $fb = $this->request('fightFactionBattle', array('faction_war_id' => $fightId));
        $this->staminaTime  = time();
        $this->stamina = $fb['stamina'];
        $ret = array('winner' => true);
        if (empty($fb['winner'])) {
            $ret['winner'] = false;
        }
        return $ret;
    }

