    // TODO
    public function setCardsForDesk($deckId, $hash)
    {
        $ret = $this->clearDeck($deckId);
        if (!$ret) return false;
        $cards = $this->getCardsFromDeckHash($hash);
        foreach ($cards as $cardId) {
            $card = $this->container->get('helper.cards')->getCardById($cardId);
            $commander = $card->isCommander();
            $ca = $this->cardAvailable($cardId);
            if ($ca == -2) continue; // card wasnt found
            if ($ca == -1) { // card found, but used
                $decks = $this->getDecksForCard($cardId);
                $found = false;
                foreach ($decks as $caDeckId) {
                    if ($caDeckId != $deckId) {
                        if ($commander) {
                            foreach ($this->myCards as $myCardId => $u) {
                                if ($myCardId == $cardId) continue;
                                $myCard = $this->container->get('helper.cards')->getCardById($myCardId);
                                if (!$myCard->isCommander()) continue;
                                if ($u['num_used'] >= $u['num_owned']) continue;
                                $ret = $this->setCardToDeck($caDeckId, $myCardId);
                                break;
                            }
                        } else {
                            $ret = $this->removeCardDeck($caDeckId, $cardId);
                        }
                        if (!$ret) continue;
                        $found = true;
                        break;
                    }
                }
                if (!$found) continue; // card used in deck for filling
            }
            $ret = $this->setCardToDeck($deckId, $cardId);
        }
        return true;
    }

    public function cardAvailable($cardId)
    {
        if (empty($this->myCards[$cardId])) return -2;
        if ($this->myCards[$cardId]['num_used'] >= $this->myCards[$cardId]['num_owned']) {
            return -1; // used
        }
        return 1;
    }

    public function getDecksForCard($cardId)
    {
        $decks = array();
        //$card = $this->allCards[$cardId];
        $commander = false;
        if ($cardId >= 1000 && $cardId < 2000) {
            $commander = true;
        }
        foreach ($this->myDescks as $deck) {
            if ($commander && $deck['commander_id'] == $cardId) {
                $decks[] = $deck['deck_id'];
            } else {
                if (!empty($deck['cards'][$cardId])) {
                    for ($i = 0; $i < $deck['cards'][$cardId]; $i++) {
                        $decks[] = $deck['deck_id'];
                    }
                }
            }
        }
        return $decks;
    }


    public function getCurrentDeck()
    {
        foreach ($this->myDescks as $deck) {
            if ($deck['deck_id'] == $this->activeDeckId) {
                return $deck;
            }
       }

       return false;
    }

    public function setDeckCards($deckId, $commanderId, $cards)
    {

        if ($deckId === false) {
                   $deckId = $this->activeDeckId;
        }

         $prepCards = array();
         foreach ($cards as $cardId) {
         if (empty($prepCards[$cardId])) {
                 $prepCards[$cardId] = 0;
             }
             $prepCards[$cardId]++;
        }
        $result = $this->request(
            'setDeckCards',
            array(
                'commander_id'  => $commanderId,
                'cards'         => json_encode($prepCards),
                'deck_id'       => $deckId
            )
        );
        if (empty($result['result'])) {
            return false;
        }
        //$this->myCards = $result['user_cards'];
        $this->updateMyCards($result['deck_cards']);
        $this->updateMyDeck($result['deck_data']);

        return true;
    }

    public function setCardToDeck($deckId, $cardId)
    {
        $result = $this->request(
            'addCardDeck',
            array(
                'card_id'   => $cardId,
                'deck_id'   => $deckId
            )
        );
        if (empty($result['result'])) return false;
        $this->updateMyCards($result['deck_cards']);
        $this->updateMyDeck($result['deck_data']);
        return true;
    }

    public function clearDeck($deckId)
    {
        $result = $this->request('clearDeck', array('deck_id' => $deckId));
        if (empty($result['result'])) return false;
        $this->updateMyCards($result['deck_cards']);
        $this->updateMyDeck($result['deck_data']);
        return true;
    }

    public function removeCardDeck($deckId, $cardId)
    {
        $result = $this->request(
            'removeCardDeck',
            array(
                'card_id'   => $cardId,
                'deck_id'   => $deckId
            )
        );
        if (empty($result['result'])) {
            return false;
        }
        $this->updateMyCards($result['deck_cards']);
        $this->updateMyDeck($result['deck_data']);
        return true;
    }

    public function updateMyCards($delta)
    {
        foreach ($delta as $cardId => $change) {
            $this->myCards[$cardId] = $change;
        }
    }

    public function updateMyDeck($deck)
    {
        foreach ($this->myDescks as &$mdeck) {
            if ($mdeck['deck_id'] != $deck['deck_id']) {
                continue;
            }
            $mdeck = $deck;
            return true;
        }
        return false;
    }

