    private function getAttackConquestTileSlotAfter($data, $slotId)
    {
        $slot = NULL;
        foreach ($data['system']['slots'] as $slotCur)
        {
            if($slotCur['system_slot_id'] != $slotId) continue;
            $slot = $slotCur;
            break;
        }

        return $slot;
    }


