                'system_id' => $systemId,
                'slot_id'   => $slotId,
            )
        );

        if(isset($t['result']) && $t['result'] == false){
            return array(
                'ok' => false,
                'error' => $t['msg'],
            );
        }
        $this->stamina -= 20;
        $isDefender = !empty($t['is_defender']);
        $enemyDeck = array();

        $enemyCommanderId = $isDefender ? $t['attack_commander'] : $t['defend_commander'];
        $i = 0;
        $isMyTurn = $isDefender;
        while (true) {
            $isMyTurn = !$isMyTurn;
            $turn = @$t['turn'][++$i];

            if ($isMyTurn) {
                continue;
            }

            if (!$turn) {
                break;
            }

            if (empty($turn['plays'])) {
                continue;
            }

            $cardUid = $turn['plays'][0][0];
            $enemyDeck[] = $t['card_map'][$cardUid];
        }

        $enemyFullDeck = $enemyDeck;
        array_unshift($enemyFullDeck, $enemyCommanderId);

        $this->tileAttackCD[$systemId.':'.$slotId] = time() + self::CONQUEST_ATTACK_TILE_CD;
        $slotData = $this->getAttackConquestTileSlotAfter($t, $slotId);
        return array(
            'ok'                => true,
            'enemyCommanderId'  => $enemyCommanderId,
            'enemyDeck'         => $enemyDeck,
            'enemyDeckHash'     => $this->container->get('helper.deck')->getDeckHashFromCards($enemyFullDeck, false),
            'winner'            => !empty($t['winner']),
            'health'            => $slotData['health'],
            'defeated'          => $slotData['defeated'],
            'protectionEndTime' => $slotData['protection_end_time']
        );
    }

    public function canAttackTile($systemId, $systemSlotId)
    {
        if ($this->getStamina() < 20) {
            return array('ok' => false, 'error' => 'small stamina');
        }

        if (empty($this->tileAttackCD[$systemId.':'.$systemSlotId])) {
            return array('ok' => true, 'no tile attack CD');
        }

        if (time() > $this->tileAttackCD[$systemId.':'.$systemSlotId]) {
            return array('ok' => true);
        }

        return array('ok' => false, 'error' => 'need to wait', 'wait' => $this->tileAttackCD[$systemId.':'.$systemSlotId] - time());
    }

    public function getMyCards()
    {
        return $this->myCards;
    }
}



